import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

import { BrowserRouter, Route, Switch, Redirect } from "react-router-dom";
import { Provider } from "react-redux";
import { createStore, applyMiddleware, compose } from "redux";
import promise from "redux-promise";
import rootReducer from "./reducers/root";
import SignUp from './components/Authentication/SignUp';
import SignIn from './components/Authentication/SignIn';

import Home from './components/Home/Home';
import NavBar from './components/NavBar/NavBar';
import Email from './components/Notifications/Email';

import VideocamIcon from '@material-ui/icons/Videocam';
import { icon } from "../src/styles/icon";
import { iconContainer } from "../src/styles/icon";
import { Card } from '@material-ui/core';

const composePlugin = window.__REDUX_DEVTOOLS_EXTENSION_COMPOSE__ || compose;
const store = createStore(rootReducer, composePlugin(applyMiddleware(promise)));

class App extends Component {
 render() {

   return(
      <Provider store = {store}>
       <BrowserRouter>
            <Switch>
            <Route path='/signup' component={SignUp} />
            <Route path='/signin' component={SignIn} />
            <Route exact path='/live-surveillance' component={Home} />
            <Redirect from="/" to="/live-surveillance" />
            </Switch>
       </BrowserRouter>
     </Provider> 
   )
 }
}

export default App;
